package com.seraph.hrms.database.service.impl;import java.util.List;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import com.seraph.hrms.database.dao.SurveyResponseDAO;import com.seraph.hrms.database.entity.SurveyResponse;import com.seraph.hrms.database.service.SurveyResponseService;/** * @author  Adrian Jasper K. Chua * @version 1.0 * @since   11 December 2017 */@Servicepublic class SurveyResponseServiceImpl		extends AbstractService<SurveyResponse, Long, SurveyResponseDAO> 		implements SurveyResponseService {	@Autowired	protected SurveyResponseServiceImpl(SurveyResponseDAO dao) {		super(dao);	}	@Override	public List<SurveyResponse> findAllByPersonnelOrderedNaturally(Long personnelId) {		return dao.findAllByPersonnelOrderedNaturally(personnelId);	}}
